import React from 'react'
import './RightInfo.css'

function RightInfo() {
  return (
    <div className='rightinfo'>
        <h1>Olotu Michael</h1>
        <h4 className='rightinfo__career'>Frontend Developer</h4>
        <h2>Profile</h2>
    </div>
  )
}

export default RightInfo
